class UnreferencedColumn extends TextColumn{async renderContent(t,e){return`<td ${this.cellOptions}>${await this.getText()+await this.getHiddenInput(e)}</td>`}async getText(){return"function"==typeof this.textOnInsert?this.textOnInsert():this.textOnInsert}async getHiddenInput(t){let e="function"==typeof this.valueOnInsert?this.valueOnInsert():this.valueOnInsert;e=Array.isArray(e)?Array.isArray(e):[e];const n=[];return e.forEach(t=>{n.push({value:t})}),InputHelper.getHiddenInput(this.templateInputName,n,t)}}